import MenuTopo from "./componentes/MenuTopo";
import Botao from "./componentes/Botao";

function App() {

  return (
    <div className="App">
      <MenuTopo/>
      <Botao nome='Jogo 1' imagem = '/imagens/dashAndGetOut.png'/>
      <Botao nome='Jogo 2' imagem = '/imagens/grazinha.png'/>

    </div>
  );
}

export default App;
